 INSERT INTO srdb.assessment VALUES('NEFSC-SURFNWATL-1965-2008-ANDERSON', 'NEFSC', 'SURFNWATL', 'ANDERSON', '2011-01-14', '2011-01-17 15:34:12', '1965-2008', 'http://www.nefsc.noaa.gov/publications/crd/crd1003/', '', '', '', 1, 1, 'KLAMZ', 'The KLAMZ assessment model is based on the Deriso-Schnute delay-difference equation. It gives the same results as explicitly age-structured models (e.g. Leslie matrix model) if fishery selectivity is “knife-edged”, if somatic growth follows the von Bertalanffy equation, and if natural mortality is the same for all age groups in each year. ', '../spreadsheets/ANDERSON-SURFNEUSA-2010-editedDR.xls') ; 
